int LidarSickSensorInfo_publish(zcm_t* zcm, const char* channel, const LidarSickSensorInfo* p)
{
      uint32_t max_data_size = LidarSickSensorInfo_encoded_size (p);
      uint8_t* buf = (uint8_t*) malloc (max_data_size);
      if (!buf) return -1;
      int data_size = LidarSickSensorInfo_encode (buf, 0, max_data_size, p);
      if (data_size < 0) {
          free (buf);
          return data_size;
      }
      int status = zcm_publish (zcm, channel, buf, (uint32_t)data_size);
      free (buf);
      return status;
}

struct _LidarSickSensorInfo_subscription_t {
    LidarSickSensorInfo_handler_t user_handler;
    void* userdata;
    zcm_sub_t* z_sub;
};
static
void LidarSickSensorInfo_handler_stub (const zcm_recv_buf_t* rbuf,
                            const char* channel, void* userdata)
{
    int status;
    LidarSickSensorInfo p;
    memset(&p, 0, sizeof(LidarSickSensorInfo));
    status = LidarSickSensorInfo_decode (rbuf->data, 0, rbuf->data_size, &p);
    if (status < 0) {
        fprintf (stderr, "error %d decoding LidarSickSensorInfo!!!\n", status);
        return;
    }

    LidarSickSensorInfo_subscription_t* h = (LidarSickSensorInfo_subscription_t*) userdata;
    h->user_handler (rbuf, channel, &p, h->userdata);

    LidarSickSensorInfo_decode_cleanup (&p);
}

LidarSickSensorInfo_subscription_t* LidarSickSensorInfo_subscribe (zcm_t* zcm,
                    const char* channel,
                    LidarSickSensorInfo_handler_t f, void* userdata)
{
    LidarSickSensorInfo_subscription_t* n = (LidarSickSensorInfo_subscription_t*)
                       malloc(sizeof(LidarSickSensorInfo_subscription_t));
    n->user_handler = f;
    n->userdata = userdata;
    n->z_sub = zcm_subscribe (zcm, channel,
                              LidarSickSensorInfo_handler_stub, n);
    if (n->z_sub == NULL) {
        fprintf (stderr,"couldn't reg LidarSickSensorInfo ZCM handler!\n");
        free (n);
        return NULL;
    }
    return n;
}

int LidarSickSensorInfo_unsubscribe(zcm_t* zcm, LidarSickSensorInfo_subscription_t* hid)
{
    int status = zcm_unsubscribe (zcm, hid->z_sub);
    if (0 != status) {
        fprintf(stderr,
           "couldn't unsubscribe LidarSickSensorInfo_handler %p!\n", hid);
        return -1;
    }
    free (hid);
    return 0;
}

